:"data";s:239:"https://ru.wordpress.org/news/2020/03/%d0%bf%d1%80%d0%b8%d0%b5%d0%bc-%d0%b7%d0%b0%d1%8f%d0%b2%d0%be%d0%ba-%d0%bd%d0%b0-%d0%b2%d1%8b%d1%81%d1%82%d1%83%d0%bf%d0%bb%d0%b5%d0%bd%d0%b8%d0%b5-%d0%bd%d0%b0-wordcamp-moscow-2020-%d0%be%d1%82%d0%ba/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 10 Mar 2020 16:29:27 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:14:"Новости";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:25:"Общие вопросы";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:15:"WordCamp Russia";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:32:"https://ru.wordpress.org/?p=2168";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:727:"Ознакомиться с подробностями и подать заявку можно по ссылке: https://2020.moscow.wordcamp.org/call-for-speakers/ Прием заявок от спикеров будет идти до 20 апреля или до момента формирования расписания. Решение по каждой заявке будет отправлено в ответном письме до 1-го мая. Быть опытным спикером не обязательно, гораздо важнее разбираться в теме и желание поделиться опытом и знаниями. Сомневаетесь? Ознакомьтесь с [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:17:"Denis Yanchevskiy";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1147:"\n<p>Ознакомиться с подробностями и подать заявку можно по ссылке: <a href="https://2020.moscow.wordcamp.org/call-for-speakers/">https://2020.moscow.wordcamp.org/call-for-speakers/</a></p>\n\n\n\n<p>Прием заявок от спикеров будет идти до 20 апреля или до момента формирования расписания. Решение по каждой заявке будет отправлено в ответном письме до 1-го мая.</p>\n\n\n\n<p>Быть опытным спикером не обязательно, гораздо важнее разбираться в теме и желание поделиться опытом и знаниями. Сомневаетесь? <a href="https://2020.moscow.wordcamp.org/10-reasons-to-become-a-speaker-at-wordcamp/" target="_blank" rel="noreferrer noopener">Ознакомьтесь с 10 причинами стать спикером</a>.</p>\n\n\n\n<p>Любые вопросы можно задать по адресу <a href="mailto:moscow@wordcamp.org">moscow@wordcamp.org</a>.</p>\n\n\n\n<p></p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:63:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n					\n										\n					\n		\n		\n			";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:3:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:78:"Продажа билетов на WordCamp Moscow 2020 уже открыта!";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:220:"https://ru.wordpress.org/news/2020/03/%d0%bf%d1%80%d0%be%d0%b4%d0%b0%d0%b6%d0%b0-%d0%b1%d0%b8%d0%bb%d0%b5%d1%82%d0%be%d0%b2-%d0%bd%d0%b0-wordcamp-moscow-2020-%d1%83%d0%b6%d0%b5-%d0%be%d1%82%d0%ba%d1%80%d1%8b%d1%82%d0%b0/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 03 Mar 2020 07:00:00 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:14:"Новости";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:25:"Общие вопросы";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:15:"WordCamp Russia";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:32:"https://ru.wordpress.org/?p=2160";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:652:"Приобрести билет Вы можете на странице регистрации мероприятия. Конференции WordCamp в Москве проводятся c 2013 года и обычно в последний месяц лета на площадке Digital October. Мы решили нарушить традицию и провести мероприятие в другое время и на новом месте. На этот раз технопарк «ФизТехПарк» радушно встретит всех участников 30-го мая! На конференции будет два [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:17:"Denis Yanchevskiy";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2329:"\n<figure class="wp-block-image size-large"><img src="https://ru.wordpress.org/files/2020/03/Frame-4-1024x273.jpg" alt="" class="wp-image-2164" srcset="https://ru.wordpress.org/files/2020/03/Frame-4-1024x273.jpg 1024w, https://ru.wordpress.org/files/2020/03/Frame-4-300x80.jpg 300w, https://ru.wordpress.org/files/2020/03/Frame-4-768x205.jpg 768w, https://ru.wordpress.org/files/2020/03/Frame-4.jpg 1200w" sizes="(max-width: 1024px) 100vw, 1024px" /></figure>\n\n\n\n<p>Приобрести билет Вы можете на странице <a rel="noreferrer noopener" href="https://2020.moscow.wordcamp.org/tickets/" target="_blank">регистрации</a> мероприятия.</p>\n\n\n\n<p>Конференции WordCamp в Москве проводятся c 2013 года и обычно в последний месяц лета на площадке Digital October. Мы решили нарушить традицию и провести мероприятие в другое время и на новом месте. На этот раз технопарк «ФизТехПарк» радушно встретит всех участников 30-го мая!</p>\n\n\n\n<p>На конференции будет два потока. Вы сможете посетить основной поток из 10-11 докладов в Главном зале и участвовать в 2-3 мастер-классах в Малом зале. Также будет организован хелпдеск, где вы сможете задать вопросы и проконсультироваться у профессиональных разработчиков по поводу своих сайтов и проектов в течение дня.</p>\n\n\n\n<p>WordCamp это ключевое событие года для WordPress-сообщества в Москве и за ее пределами. Наша задача сделать конференцию яркой, запоминающейся и максимально полезной для каждого участника.</p>\n\n\n\n<p>Приобрести билет Вы можете на странице <a href="https://2020.moscow.wordcamp.org/tickets/" target="_blank" rel="noreferrer noopener">регистрации</a> мероприятия.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:60:"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:3:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:101:"Ежегодный опрос пользователей и разработчиков WordPress 2019";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:57:"https://ru.wordpress.org/news/2019/11/2019-annual-survey/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 03 Nov 2019 08:53:02 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:14:"Новости";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:25:"Общие вопросы";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:32:"https://ru.wordpress.org/?p=2141";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:721:"Каждый год сообщество WordPress проводит ежегодный опрос для пользователей и участников сообщества. В этом году мы рады предложить вам опрос не только на английском, но и на русском языке (также были добавлены испанский, французский, немецкий и японский). Опрос будет проводиться в течении четырех недель, результаты будут опубликованы в английском блоге WordPress.org. Сбор данных осуществляется в [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:3:"Yui";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3075:"\n<div class="wp-block-media-text alignwide has-media-on-the-right"><figure class="wp-block-media-text__media"><img src="https://ru.wordpress.org/files/2019/11/image-12-1.png" alt="" class="wp-image-2145" srcset="https://ru.wordpress.org/files/2019/11/image-12-1.png 768w, https://ru.wordpress.org/files/2019/11/image-12-1-300x134.png 300w" sizes="(max-width: 768px) 100vw, 768px" /></figure><div class="wp-block-media-text__content">\n<p style="font-size:18px">Каждый год сообщество WordPress проводит ежегодный опрос для пользователей и участников сообщества. </p>\n</div></div>\n\n\n\n<p>В этом году мы рады предложить вам опрос не только <a href="https://wordpressdotorg.survey.fm/wordpress-2019-survey-english" target="_blank" rel="noreferrer noopener" aria-label="на английском (opens in a new tab)">на английском</a>, но и на русском языке (также были добавлены <a href="https://wordpressdotorg.survey.fm/wordpress-2019-survey-spanish">испанский</a>, <a href="https://wordpressdotorg.survey.fm/wordpress-2019-survey-french">французский</a>, <a href="https://wordpressdotorg.survey.fm/wordpress-2019-survey-german">немецкий</a> и <a href="https://wordpressdotorg.survey.fm/wordpress-2019-survey-japanese">японский</a>). Опрос будет проводиться в течении четырех недель, результаты будут опубликованы в <a rel="noreferrer noopener" aria-label="английском блоге WordPress.org (opens in a new tab)" href="https://wordpress.org/news/" target="_blank">английском блоге WordPress.org</a>.</p>\n\n\n\n<p>Сбор данных осуществляется в полном соответствии с <a href="https://ru.wordpress.org/about/privacy/" target="_blank" rel="noreferrer noopener" aria-label="политикой конфиденциальности WordPress.org (opens in a new tab)">политикой конфиденциальности WordPress.org</a>: все данные будут анонимизированы и не будут ассоциироваться с IP-адресами и адресами e-mail.</p>\n\n\n\n<div class="wp-block-button"><a class="wp-block-button__link has-text-color has-very-light-gray-color has-background has-vivid-cyan-blue-background-color" href="https://wordpressdotorg.survey.fm/wordpress-2019-survey-russian">Пройти опрос</a></div>\n\n\n\n<p>Если вы ответите, что принимали участие в жизни сообщества или сделали что-либо для WordPress, то вам будет предложен дополнительный опрос для участников сообщества. Каждый из опросов займет примерно 5 минут.</p>\n\n\n\n<p>Дополнение: опрос был продлён до 16 декабря.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:63:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n					\n										\n					\n		\n		\n			";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:3:{s:0:"";a:6:{s:5:"title"