rg/files/2019/08/b46860.png" alt="" /></figure></div>\n\n\n\n<p>Второй WordCamp в Санкт-Петербурге пройдет 28 сентября. Для ознакомления с подробностями о мероприятии, а также если вы хотите стать спикером или волонтёром, посетите сайт: <a rel="noreferrer noopener" aria-label="https://2019.saintpetersburg.wordcamp.org/ (opens in a new tab)" href="https://2019.saintpetersburg.wordcamp.org/" target="_blank">https://2019.saintpetersburg.wordcamp.org/</a></p>\n\n\n\n<figure class="wp-block-image"><img src="https://ru.wordpress.org/files/2019/08/YP_0081-gallery-2-1024x629.jpg" alt="" class="wp-image-2125" srcset="https://ru.wordpress.org/files/2019/08/YP_0081-gallery-2-1024x629.jpg 1024w, https://ru.wordpress.org/files/2019/08/YP_0081-gallery-2-300x184.jpg 300w, https://ru.wordpress.org/files/2019/08/YP_0081-gallery-2-768x472.jpg 768w, https://ru.wordpress.org/files/2019/08/YP_0081-gallery-2.jpg 1680w" sizes="(max-width: 1024px) 100vw, 1024px" /><figcaption>Конференция пройдет в пространстве коворкинга &#171;Ясная Поляна&#187; ул. Льва Толстого 1-3</figcaption></figure>\n\n\n\n<p>Заказ билетов на мероприятие доступен уже сегодня!</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:60:"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:3:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:61:"WordPress Translation Day 4 — Санкт-Петербург";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:152:"https://ru.wordpress.org/news/2019/05/wordpress-translation-day-4-%d1%81%d0%b0%d0%bd%d0%ba%d1%82-%d0%bf%d0%b5%d1%82%d0%b5%d1%80%d0%b1%d1%83%d1%80%d0%b3/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 09 May 2019 11:53:21 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:14:"Новости";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:25:"Общие вопросы";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:32:"https://ru.wordpress.org/?p=2099";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:685:"Друзья! Ни для кого не секрет, что 11-го мая проходит всемирный суточный марафон перевода WordPress. В рамках https://wptranslationday.org/ в Петербурге очная часть пройдет по адресу 9-я Советская, 18 (пространство funhouse, цоколь) с 12.00 до 21.00. Вход свободный в любое время. В программе &#8212; философия WordPress полиглотов, инструктаж, практическая часть, где мы переводим непереведенные плагины, темы, [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:3:"Yui";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1478:"\n<p>Друзья! Ни для кого не секрет, что 11-го мая проходит всемирный суточный марафон перевода WordPress. В рамках <a href="https://wptranslationday.org/">https://wptranslationday.org/</a>  в Петербурге очная часть <a href="https://www.meetup.com/St-Petersburg-WordPress-Meetup/events/261316455/" target="_blank" rel="noreferrer noopener" aria-label="пройдет (opens in a new tab)">пройдет</a> по адресу 9-я Советская, 18  (пространство funhouse, цоколь) с 12.00 до 21.00. Вход свободный в любое  время.</p>\n\n\n\n<p>